import React from 'react'
import { ReactNavbar } from 'overlay-navbar'
import logo from '../../images/logo.png'
function Header() {
    return (
        <ReactNavbar
            burgerColor="#eb4034"
            burgerColorHover="#a62d4"
            logo={logo}
            logoWidth="100px"
            logoHeight="100px"
            navColor1="white"
            logoHoverSize="100px"
            link1Text="Home"
            link2Text="Product"
            link3Text="Home"
            link4Text="Home" />
    )
}

export default Header;
